import React , {Component, component} from "react";
import vegeta from './../images/vegeta.png'

class Vegeta extends Component{
    state={
        hits: 0
    }
    addOne(){
        this.setState()
    }
    render(){
        return(
            <div className="col">
                <img src={vegeta} alt="vegeta"/><br/>
                <button className="btn btn-success m-3" onClick={this.addOne}>frappe</button>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>Count:</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Count : {this.state.hits}</td>
                        </tr>
                    </tbody>

                </table>
            </div>
        )
    }
}
export default Vegeta;
